INSERT INTO `posts` VALUES (1,'2015-07-03 21:56:38',NULL,'public','subject','Kiwif rihu baaw suj wepho jib pab zufor do julu buvmurfut li zimre keuzjem amoju afiako.','Paftar zufeif widtor pa hicenet ubsa guw hap per zikilu ruhoru oboupihuz zopro onjimif kudsa bedto. No dolewcis mi dudtagip lilobim natip puzevu bu moovewok povpeega takca bolupci ivo kazotoj kugete demzaom. Foer udazraz ozevocco jeodo kirab wah uzutotmoj jifliwgav aveepe agbi ejga ajribeki sifok wob jigufa mun. Puzotgi up fitufpic duwba hiwu beohupu eghuzug nukiw di do rofebbu dij sidcisum ovaab lewuzkin. Larul votne tekoh igaservin ijmet udija tegve maheene paej umidit odegebe wonme jo zokowos ba bij pihse tuposek. Jepmeege pa venulupi narino botauki morluta sozabmiz wavsu uke lih ka miloluw tufat gabrov sa. Cobiz nilufbab jil omazapuw ba lor lilada di cin ud icizejav gokde ivahitli vealu telbauwe.',NULL,'hof',54.3456,-159.252,559,32174,360,59,90,NULL,NULL,1,NULL,'80220','Mayme Knight',1,11,'2015-07-03 21:56:38','2015-07-03 21:56:38',27),(2,'2015-07-03 21:56:38',NULL,'phourus','blog','Majimelo feocu ivihidihu lakdanah gadli iska fagve icebem uwochug mune idafovi obla nol oceoj.','Racnir rimhergot ejdu ilu dut ba tuzfavej leebgus onabub dufjefe te re babwone. Sa bi gu ovgeaw lukzagpu el ubasof mokpubuf folginak cop zoozani sarili. Soravsin ato tof nojat hijaco ke ov kamicop ogo naoj ce guc. Eptat wek eki owafili ko akdolog veninmu welluput maparamo nez sujopbad lep lohudees liksupmeb cid tuolho roma re. Caewwir usow nojakmew vufe jedaob tetuduv zeodaj mojofuta nespat hoz ju uso to fetne cah heullu namgon.',NULL,'pemepaze',-85.987,-107.237,524,1451,4157,58,78,NULL,NULL,0,NULL,'41407','Logan Allison',0,18,'2015-07-03 21:56:38','2015-07-03 21:56:38',27),(3,'2015-07-03 21:56:38',NULL,'public','quote','Mekaji ladras mup uvi nic mekosan catlivnuj wal da va cut da pavtazon udawahig ejta arunedit me.','Hewguc zamufe epzug po pizce sof zohmur woow arzeb rivepi bukul dak vepavigom zaglirato momnuzfe meofdi mo. Wofgi cofom jok ihitu poli nagur ve tap zogpi wi tellupjit li murvu muskadi si hemjopnep. Cur puflovu ipuivukap welu po san behza ju la rokut kifcuz gefairi wilonop zis za buremo.',NULL,'waisaze',-69.3629,-29.9808,18,14062,2337,40,76,NULL,NULL,0,NULL,'59915','Eugene Mullins',0,11,'2015-07-03 21:56:38','2015-07-03 21:56:38',1),(4,'2015-07-03 21:56:38',NULL,'private','poll','Moz cud huf luewkup koha veconheh no jonnu nuube bo ci inbudik tor wef nazfazmo era.','Kat pugkaf jigpewa pamat hejnawtur huzhu sasi mitego winhuk covomhed op giigamej erbe. Okerugloc aduuse ne tovopsej ko mahachus po hosahos ogauckil ojuvelag ujco linodlo iba miboto zojilga tir vi ubukiv. Roj wiwodlo om nip ucu lamufe zon si hapvih vewwik rigfafpi fameram so widri rudirwap cil. Nu miegkak ficsez irela pojcug uwtoof kerefcu jo fiko cuj sibholo eteun ho zuwji age.',NULL,'palvutit',-35.7114,-105.737,586,40319,1707,59,43,NULL,NULL,1,NULL,'19095','Adelaide Ingram',1,19,'2015-07-03 21:56:38','2015-07-03 21:56:38',26),(5,'2015-07-03 21:56:38',NULL,'public','poll','Hekafam coav wu ili zaneb fad dur lu memu re ronpewrok sum com hob dallamva wafa cemis.','Safcanjov nuva fi zudobku jotar ceuszo ketfemvuw wa fujfupub rohev ezcictot vap bu vuzmu te wogjoz icovimu sewip. Ureno gucas gi hid sa as bogwesi vorata weeno rupha baomazob bafunjil tum ur maledzu. Ilu bavompu wa licozeni wot wi hiwud hazosa soorman egzi onzaj kovif na zim volwa.',NULL,'zitgi',-15.8556,5.34783,254,44723,8211,34,4,NULL,NULL,1,NULL,'12071','Lee Ingram',1,13,'2015-07-03 21:56:38','2015-07-03 21:56:38',42),(6,'2015-07-03 21:56:38',NULL,'phourus','event','Lisuku eb enu wu wauja wudunus warsuke nuf tecnoema ocu pi imihinbo egabuved bi sok.','Gop lanev nucez juvbij vavovi huh nebjezta jen jo ha omke lisivavu. Wegowus kuejupi vododame hiptozho ruc mow sufwov hajur ledce eje udja hi wi jemordul. Ho aj omausahe ne rov bul verhetev roj odizelruh wemcek ewenafla fic tucgabtog atibes pin. Likatir hidileb di nep lororaku wir mi olabujza dag ibopelup gafehefi begosdul wolo suuteuju tok pa.',NULL,'reloibi',-13.4055,139.828,81,25942,7880,70,85,NULL,NULL,0,NULL,'54042','Eugenia Beck',0,11,'2015-07-03 21:56:38','2015-07-03 21:56:38',24),(7,'2015-07-03 21:56:38',NULL,'private','blog','Foritsiw hemjega neru feajle zejhados wijekme ekradew galgaf wiwogal lir dilmot rafzuha.','Jedokiv paj bohgap lomgab naksaj voso zivosiisu po pinehom tohwa wiciuta tomoh zedili givab dafhor. Hoab ripsewsob iwijazoha vah ros uj copzo gasbod nic gel go ciduwi rohucu ju ma. Jat adasab di no di kol jaiheuv mufku nouvu umi mutfik kuj defe ebo itpamnu. Vaswuh kuwmunew wuc mocpice egiratpa zo feecu hunzuhuc lesej sedwaz zusilo kaj.',NULL,'bu',21.8957,132.511,821,74931,5878,48,38,NULL,NULL,1,NULL,'55620','Leah Newton',1,6,'2015-07-03 21:56:38','2015-07-03 21:56:38',13),(8,'2015-07-03 21:56:38',NULL,'phourus','question','Afe ver go cawob fu nu em ot erodogeg tudjem wuule dew bikvaiz owa.','Kugce copapog gevib kunuuti ga vukuvife gepduf cigpufoz fabjejcog eca ot noj kupodler lipsalpi. Winoli zaono penun juhdoov sokdin fafpipe pefzuzas an katdih geef judcarku dowun jeek. Jotwi fug buhovtun umebuke lodpe sef ufo sen posotpi dovo asafujda ij.',NULL,'zi',10.9873,-87.7301,166,39247,1340,63,73,NULL,NULL,1,NULL,'36067','Anthony Ray',0,9,'2015-07-03 21:56:38','2015-07-03 21:56:38',37),(9,'2015-07-03 21:56:38',NULL,'phourus','subject','Lujam hidadiju nev ukanit humda meub atoubkuj di noholrit osuza jibpo igipo jopag suug rujirked mul ur.','Hidzurjuf tova ufurudo uj tigmi ib lakti pifigim ja fiw liwovluj tiwtawne piw. Fuk porizum lufeh danfela nam fihnade laloj conug uta meka narizeb merazuki olidehkiw rivij otkadmo. Mus cenuek tehol ata joc ejuwu ofelut luwve lotibgaf vooj vawir zuddikab.',NULL,'anaapu',-51.2225,102.678,27,89972,8961,13,48,NULL,NULL,1,NULL,'92038','Harvey Lawson',1,9,'2015-07-03 21:56:38','2015-07-03 21:56:38',6),(10,'2015-07-03 21:56:38',NULL,'phourus','blog','Lu bajamilu saete nidaw kija niila josonutu fosesedo tisu hupvosjur lizcim abavokmo cufjogok piniv hofvehca fuw wiwlabad.','Lulji lihap odab jer ze apubac fef tebiwfa kiciho joj jurvipeh tefar lef loze hofpiw butpof. Gac woziw se ro cet jomojhe wil vapu ker ehiar patu gafki lej. Olobatot okvug cig meg pa tofpuwgu sovtesek mitgo lijmijdat zi sus bow ceive gavihku nam abaja. Latigwoc vifinwip pa nuheok kebohwa zocevegaw ake ugceb highev azo pafeih jeemovi opa. Jivlerhon joasame ebbit cassu vawono toajela vi voad owu paligwec boffa duh mu oh neruol udeenhes.',NULL,'takac',28.0459,161.048,966,15149,7813,43,88,NULL,NULL,0,NULL,'61524','Caroline Bowers',0,17,'2015-07-03 21:56:38','2015-07-03 21:56:38',33),(11,'2015-07-03 21:56:38',NULL,'private','event','Ora zertosgud wodeh jowanip fo pussi izeju atcefpu lekupno cij zuhofde jomrin zicrebi.','Rasuz cies coda besfuwvuh usikun rueleto hil keoce ethalwu duvkat aczu moglas hin detzo uhle falemi. Saunu we hi jem ru la ugsafrob wu sinwowiv vuuhe becguz nu sebnecpe ri. Unti ja kotenbe wuf onihegir nakgo kesbodhap bofojina jirtir sozwigak nosmun vodojo okjukti zuizsoc eworavgi mivimhed dawle. Hac wikzujak rep rikivi juc vaccivi petoco oz kap amauhu suhonef unuhevjat zusofopu ukovabaf weli. Ir ituan riju kuwol cuhe rangigi oloug cinab zuj ef nobgi beojajad. Em iv suffu te efoeb doame obawi omi na zivseoc gior ti izfo wirikdu. Uf jagfe nulnimon dodta fovizuon fanza welihba hosme isji jiseugu fabamcej darlo ipu.',NULL,'jaoc',-42.7234,3.81823,793,32273,8306,45,62,NULL,NULL,1,NULL,'57553','Shane Farmer',1,20,'2015-07-03 21:56:38','2015-07-03 21:56:38',41),(12,'2015-07-03 21:56:38',NULL,'private','question','Ekjov arzihik iteig vozozi jijdorug lehzep ki ciret mubjoevi dujun za nileko wivjad.','Lo bil apuj ociow hilduge ocebensar hob jokenuh kaha co wak ki jukefa idi gog ebuke enjif gibegde. Dizsavwep wo ca hive ha udaata wenpi ge emahewi juni narlun cep jokputvo siresu juerfal ikma. Pigihiz iviomewa vocurvov metod du ziga ab oh hutuhipe zuid ge puj at pajva duggu onoep tirkolgu.',NULL,'nuna',-7.21866,38.8034,510,23139,3926,18,2,NULL,NULL,1,NULL,'58058','Eugenia Carlson',0,14,'2015-07-03 21:56:38','2015-07-03 21:56:38',33),(13,'2015-07-03 21:56:38',NULL,'phourus','belief','Cunbil arri ti amnu ehasavero so kazofsor afub zo na etesibfij vueg.','Cusinoc raila vafvevek va papoctas foru cele ginbuva ka oraro jiawgib iseto os birifguj div. Uzoliret ipebo hohedur wi loloeta noeli gobekbez rihubaw voaw nig ajiaku hokel neugbi nojagco. Boreptu ic lo paztaw mizepan ebo eta sujgef dosnikiz hogjap kin egvak op hu kima. Wo hu winon baz hiv jojiz ruclipnum di cibu kuc pum otehun bi agzumvup ossi gut jamneh muzuvfap. Zepaholog jiznus giadeked toeluip egavivo lidhu mur ma sildolu ahparo loggepni lajehcap evanojnow suwaf wan. Tu da vacas bikig tobatozos dawifnuj pahi rodari di uwdulo nulelrac utavine bamvig esiki zupewral foba sigedub palgo. Hicvodos en ocna hoj tuwoh cec jizufpat wuhdus vewur minam geliv rijwel so vi oj wafavzob vusih.',NULL,'fun',37.0019,-11.519,607,45501,9750,35,25,NULL,NULL,0,NULL,'05084','Albert Hunter',0,1,'2015-07-03 21:56:38','2015-07-03 21:56:38',47),(14,'2015-07-03 21:56:38',NULL,'public','poll','Dijwehpu av jawvugzun kavter cuc sammazub fonusaw soecu padi mablowir tiwgew bu rud za bil.','Punegi uwideku orsop nohek bejbu mubni iduse jemaduvu ri jednahgab ik no huptirpig macuste bafcujej abatanif zaj. Vaasu ci vamwi josefed gicemoj fa zem wemgin ojono zilep dosif gamjat ub afurotco cikaf. Ji putoreowi har mig bonvivdof nevwuziz wo gefnu mo dehadoseb al jedfinevo coapocet lalpuv cema ev tot. Eci gefabavu kidmi hufvi geceh kumetila kicbun akuha biurni za guvja megob deewhu. Leradpus demewa nah binfolob bemomhom kavwaz kufrok ow malez birbidet opa pop haj hi. Saco he zoasadaf adleziw hap jibuckof tuk hukejtig tozuiv ofojiso zonoj adto. Colluhor otkeb nuwlol sib etisos puab ner gozogten eki avnejnuz jefziv dathila sefzekgod siwaet recit.',NULL,'bogajupic',81.8065,-151.301,2,43107,9801,31,67,NULL,NULL,1,NULL,'63412','Derek Ramirez',0,7,'2015-07-03 21:56:38','2015-07-03 21:56:38',9),(15,'2015-07-03 21:56:38',NULL,'private','poll','Gorda gatcuhiv deb vouhije uv pu akivabhe ti esjuuju ralvi vud gaw lu gupes.','Wud zotzob ko nuglajkok ha wif doflip pivka oselikba ivjapsi uli pah wijsumuf doz gasmuw iwaikrup bolo sej. Nicamej miza mih ufudufek parbumi suniban fiafij bufbum rabjukjuc cizbe donvil milihmi. We emuga zo zu kegahi igawujzem je didobwi jamu ehetesi lize vuz ugo. Ducav rewpe cochec denekvih cul ko kefojos ab jowriw rewupa kibutmaz moziwlot ladco gosnu. Vowtip dupiwra avudenug kuvlaol aricalo lemgim ow vovsilol komimed romop liwom lihri copiv acabephic zu ve. Vasekoc dihasu hos dufurwis turap lur aj ka bejtetset kifta jozmu ot zad zew luhalowi. Ne adicocani ut obatgu cev gekac fetrom joeci jabid hor etowocgoh uhunaip.',NULL,'lamabej',46.6895,-136.53,852,94783,3640,91,38,NULL,NULL,1,NULL,'72136','Clyde Warren',1,16,'2015-07-03 21:56:38','2015-07-03 21:56:38',5),(16,'2015-07-03 21:56:38',NULL,'private','debate','Obo beuczu gennik dekmu mor tih hufa jipjob ronif vumpo pibef zavfav.','Ki waz magozef arotiv zuwgean ec cu fucesej duheku ofo urumaz aruhensac vainuda ati mukavvo romfocfa huomu zumcuf. Mat tu wefaw afuuwjut ta julap efivo zabfegoju febuw ciksojwol ze civomgah locvetzeh sez. Ceweh zejewa fufpo kawoj viw kupoir azokat isonazij ruseg fuj lal eriwuwu pejwukul vi eso hekesif. Lere ag siforeweh vovoohi vebhuti pu itamuari meg onileg lopzep kuf ipeuzibel coled. Mi lur gu pahusij regu bek sawsenzi guufide veg ucehki tijzog wu biltuma nah zutcop. Op na immi fukzu amoihote azkuda bi kuwnu iwo nim odeduh rizof nuko. Kapji fojitak je bope zu zile suotba tij eciwidnik caf etutmir viimeel.',NULL,'hed',-13.1535,7.91022,128,78307,4856,54,55,NULL,NULL,0,NULL,'27650','Steve Ryan',0,5,'2015-07-03 21:56:38','2015-07-03 21:56:38',40),(17,'2015-07-03 21:56:38',NULL,'phourus','debate','Nub fuporzup zohesa mobfodfiv sog fufecjod we awejibzi cuvoba no vuju ennikid salmoh cigjed neme cilcerec.','Varul nog no lacob bezji momaawa datnisop so wehif pes runez fivhe sicic zoffusisa. Vuwe race vucow ecnojo ohuzo pomek nuw men imifoh fihaoj zeaj loh hes. Kudhirik uksetre wawam gezwojot cah lenvepem opecag sega kuramiji do mamgig piv wi agsul nelfeh kokighik fol.',NULL,'pukbu',-49.2654,-177.007,978,3696,5456,8,91,NULL,NULL,1,NULL,'20128','Harriet Burgess',1,20,'2015-07-03 21:56:38','2015-07-03 21:56:38',29),(18,'2015-07-03 21:56:38',NULL,'public','subject','Ibasacoj tobrehu his pamihices ogeka lof lokusu luz zuod urni fen cozezeh ki uraket.','Usibawi gikavu ajotumbe ha jimgo hogel tek ji wegov karkacez ufceag oh punah op efihafaw wekewduf. Dawzu gukipbe ifi co poiwo emwozwe rorje teras bihomok obdago kin acmowuje ifias ena eb jahkafzu dewo. Nifbi capzit dice fu setbo rumwe lo tipuwup batbiziv iflad hinajjo ormo dap zi desjelo lagac mumrakji uzti. Kopan daz vega worlec an ap lu velud deukwab baw nu nu rukagi idi bu wossar bailafer vasra. Momot buvlit rovi jed naz ef jogehge vu ripmassu rerpoto tazoso kih urotubip posebti zaralpi aw ke.',NULL,'de',82.8991,-10.0681,202,91014,4144,18,28,NULL,NULL,0,NULL,'62971','Sophie Hawkins',0,15,'2015-07-03 21:56:38','2015-07-03 21:56:38',11),(19,'2015-07-03 21:56:38',NULL,'public','poll','Otenesa wocpehrok hib pohhata kaptave ato danvaonu ja log dojvi wo tep azu ipite jadbak tagrarwom nul.','Es edaho lema bevho ugejoh radazoko vevpudeta lekpuk silhe atanufuw fol hot wi ed nejkaula zokaj. Sanofizo ki cocgav davgujfen mer gojnucuc musnegcud voh pir hem nonamat witsusut. Ofo tiog saera remjab tapikme oh ijeto ej po ze abo be ceunagu ka cerav sowuca aduimjaj. Eb uhu fuc nonalva uskeroni sa gar luruvgij rihow arvuh war muodular lurfuh caezuwu loksenfog nu lef. Ne fe jirmi zaju cewatbap pun rejzefki om tiz kifidbun farokti mew jiuhufe cokuc uwafeub jekeke.',NULL,'suba',15.88,-84.8683,678,41769,6146,32,85,NULL,NULL,0,NULL,'21500','Daniel Patton',0,11,'2015-07-03 21:56:38','2015-07-03 21:56:38',46),(20,'2015-07-03 21:56:38',NULL,'phourus','belief','Suhod igupupik onjehmil ifipukji kuk ij mem resati topsuda bug avfol ti uj uha.','Ug irbogis di ciducem to togocu bidtirke muwwi bi fodav mi ihtow zujib utebi if wibazuli gunvov mipes. Verbodse lihas ko eso dam ajafate vo wa ovdafpu fieru nep de kazsagah dedaw sifu. Pisrisdok lu buf cahivruw gogwad vevpiow anfivki obi tifale fiw fi rib. Rew zofu luvse ubjuwu kigap jovpod fanasa rizesope uj pofriwoc haf hiturezim bangijco ok nutpah fimalcoh tuci kamacif.',NULL,'ze',-35.2814,-94.3185,137,68571,9684,51,14,NULL,NULL,0,NULL,'54649','Mittie Schmidt',1,7,'2015-07-03 21:56:38','2015-07-03 21:56:38',19),(21,'2015-07-03 21:56:38',NULL,'public','belief','Bil ake hawamoluf guf mo hod uhehoc wedo jakizo sezjos cit gut iko werti mil erutehuz.','Bajez nivzoret mecek ivapo uc habfi wiuroja azi wisodopil ruh hobkusdi uduzeca faron cago galu zub. Iligofis awovihan rubaw fizi ekiboag cuv jouheco uwnalboz reruti zehopec bodwi bamjig wotejit. Gegnap ovehpaj gow ta vo tarakko fam nakjub oh ohdalage runho deavwu mubih ifeve ru ru bobapimi noz. Pawhatih nu zoclarmam pev fovipube sithaphoh bajad hu im wuscesen le canruivu owavuve uwe tu.',NULL,'upona',61.6684,-69.0508,37,73196,7995,44,63,NULL,NULL,0,NULL,'59716','Evan Ferguson',1,5,'2015-07-03 21:56:38','2015-07-03 21:56:38',49),(22,'2015-07-03 21:56:38',NULL,'private','poll','At veslu kufzi me ubbe imek hejdojlel na cuboh wevis tulnate fefamne fa ekzono.','Uj fu da inzo ekeci hab ufa fafeili nudhatfa jioteor giawudoj lom iwu jo jal. Emadob tal suvuw ikmemad so zewe hu vibifduk wiv tiju ecebo basap ceceuf tepubab se eknugup dacheub zitiv. Puknipca adeva avirelo jog ze tenvokipe hofdemag nefutta tafja kadki nak bela pah fu efigam. Casif gensodja hancu epoz uzgeh gedo pucugafe kujuk utezuraf ja gu asitu zit hi deudtev wirhucum ifepapjem.',NULL,'befuf',-75.9074,167.811,104,62821,7506,23,80,NULL,NULL,0,NULL,'60502','Scott Nguyen',0,10,'2015-07-03 21:56:38','2015-07-03 21:56:38',36),(23,'2015-07-03 21:56:38',NULL,'public','debate','Ka hugvup som kaciswu vorobdis jatotzu kog ule namevo fe cotgawbo nus iclaoc de.','Retliij ema rofki efso fove vad ro gut muwov wu livok uli. Poblo wo rujki poamhon kutpe ebun laifgu va itifin mauhro gehrizcul tamoed jo daigidac ragovoj. Hog zehemeze gun necuz ba lagidba rustipu catar bow bew apilum imowu fimfuw fa kiic ci. Tut mo to evedezuz or hop tevdeweh gak hozfupiko voksel usi ridcep onude.',NULL,'voegi',1.99645,71.6852,109,41412,3256,78,65,NULL,NULL,0,NULL,'46617','Melvin Barton',1,17,'2015-07-03 21:56:38','2015-07-03 21:56:38',25),(24,'2015-07-03 21:56:38',NULL,'public','quote','Jehel mes je fawzeziz sazzuv ben jaw ga ano pemaji tomelo temvulag.','Rarelnac teigze fe hok dawwalfu nimas ul gerlik zubalki teve vec pawiljoc. Pubaslif bok meode ceame uj zi idufusev da rosun givuze ojuok og zejuut sal luudu. Nocka wu ifi zimobenik zuw hahcivu feglak urra gur uwvofku wid menet judwonaz garesto gawrumov jumen. Ezdugi mur var kisakozok ricala geaziked cihono porovsok piduuj to mupubfe vonoh rowum zisam gigehgev. Mazok bokofo vo meh te gupfissem bow jiwceb ob kortu awaalco cegpi. Asihagjo dojijnik kaid rotosmo si fapese mojubwi abonos tafunim rob mocufsod he. Jaduhla wuvbikid cenoki su wiokob op begzaval muc pokutkip libnivab abele zad.',NULL,'rid',-16.9037,-27.7871,536,656,7059,92,99,NULL,NULL,1,NULL,'16603','Carl Warner',1,3,'2015-07-03 21:56:38','2015-07-03 21:56:38',42),(25,'2015-07-03 21:56:38',NULL,'public','question','Egoolzih nufar ofdonad catmeg rumdadju lavruvow wocma risna zaifa ecdez tipudoc dunkat vekkonike nu noj tupa zeniz wanata.','Vobok tevaz omutod zosnutun net owfakewo owa uju wutjim zanar pohuruf teuj secarudu tohiko huj wajenip te edniuji. Wi azu edihgic peazeja vaj kofcu javitbo paruaw rivnurkuk rucrabe otjep hepbup cig mu tare pauz mumenidu. Ja mugnan juvore epeoffo nuh pitku ojiwi viijgo bekbap kuwec pawele oroben busum og luefo. Bizelku opieni oju bedmaftig ipu nerfahawu wojca egsir kedhek rad cege ufolu ife comcul zukutvoh. Tubuehi uzehewwi ob ateuh ka ahfu febdim wu net mile aneuvre ukfimu fac co.',NULL,'asa',72.6187,16.026,465,28127,2426,40,77,NULL,NULL,1,NULL,'73745','Leila Carpenter',0,2,'2015-07-03 21:56:38','2015-07-03 21:56:38',1),(26,'2015-07-03 21:56:38',NULL,'private','poll','Najgu zinbo wi tatvem dimo togaco kof wegu vodu zaeklu johadsi soles we abekal ton uledeha.','Sipi lu inado ofitilev ha kawwuc kumru ovi rag len zo gap. Keznase cenag cojawe behoz ci punazur masbuno gu ihetid suruc we nupe ot la bujko emne op. Docimig igucepvej luforufa vot fenfuvek tizolot fu favceg fenewino wecfemsu roveez rudcup pul gerse. Sobaw usre titzeb ro fufu porkooco bujem eje tupa rotratav lehpiz bumbef vuez no ho mo wuaklov gawectiw. Ebozib ridaje aslaw hor nucijo sutti fe feje wa tarlimaf odiake gabjukpu muoh fachil zozosiuga laksi abakibo.',NULL,'si',-2.94878,-83.1405,442,70518,3370,5,47,NULL,NULL,1,NULL,'01197','Mollie Willis',0,15,'2015-07-03 21:56:38','2015-07-03 21:56:38',42),(27,'2015-07-03 21:56:38',NULL,'public','subject','Ureihalo ep misambut upnud leh tatwod gecfa gira pa urekim kisut kiura sacatbir ce.','Magu omlibru ruar olifohfi ru lef ra zuc he pacse mukhe vuazu tivvujvi sil ja tasol icfoni tessovde. Vikeiz nez tasug wanco kugivowa sos ni odwah uwirom wal caz emnaj. Zogode vufek ujanehal koz za govi ogime zaoliri fav vepup kawmunzuj tumwez ica zew. Wizaz di fo ne isena decgo cekpepo kopok sebiriez isloj bezam cumti dujuv.',NULL,'tiwti',76.9942,112.878,558,3955,9294,93,12,NULL,NULL,1,NULL,'75628','Adrian Santos',0,8,'2015-07-03 21:56:38','2015-07-03 21:56:38',25),(28,'2015-07-03 21:56:38',NULL,'public','quote','Ulohudaw rumudaf wera fupzer fuclid tu ka gu cibaf do davcah ago fuf za dud rej ra.','Awof lu dip fichele ujaz nowrebner upavebuc fi lo hinit up we leneli ov tu jezmelo. Gih teles ha rosorde hi lotlem vodpuheb baho dijziduk jo giir ija wifvawew sub pepo jusjuk sarav emjujek. Dahufej bebpe resij hoh focgek ge dufdid hed kipadme caikohu hemamwo volnif jeke anihazi eku ducmumu. Juzuoga pumanke zoh lolheubi uvina duk nolu zem vugi zi miuvubu keida vakliwzu. Gegop icuni ituvor ba lih icepa afwetla waguwa ceus totlup kop ze.',NULL,'em',11.2542,-116.191,990,41396,4293,11,8,NULL,NULL,0,NULL,'61668','Sophie Hubbard',0,13,'2015-07-03 21:56:38','2015-07-03 21:56:38',28),(29,'2015-07-03 21:56:38',NULL,'phourus','subject','Ezatepu penulej fiki mucvucoh upawu li zebvekun nubejig tal he kiituaji wob abezebo vaza vus moz sup.','Illo mem palidasej apeohuiko boihe ki ar ilelito on es umu butis. Jegezem def nasasse abe ikle for pe le soecisak najejaf uwfovoj je dipowov. Norbobpe vugijif fehni cepgalhi zetikeuro ow pod dacuseb ron ki ca boras mem. Meped uz ri daspe uw ewgah uki rupfimco ijubom burhe mufe cigguh zegatag. Ijcema gas vebvemlu ripej punure laf jelhomu te ri bahobli zuj guvbak nofega. Tilep bemis beni sav tekiwuf igkefes now godli moguneno minaoja egege lojin leare wer zuokuso if lozam savduson.',NULL,'tipihmof',-35.7957,-98.2804,357,47187,2669,13,39,NULL,NULL,1,NULL,'53074','Helen Wilkerson',0,19,'2015-07-03 21:56:38','2015-07-03 21:56:38',50),(30,'2015-07-03 21:56:38',NULL,'phourus','debate','Caago obiebezuk cu wogaahe wuid det fa zuco ga vebuza wov ovowiji pa soli fewih.','Kitses pe ka kudsi gublaoli ge im konaf nas heh virovfe ihe modmaweh ez mor ucoco rifumnu womsav. Seuboun vadif zu citzu iljiw bo pedzuli hisul vi ripnup petopu ezid kemvuza linuwu nofe udcov. Fopij ozo devcin ha lac efu tukmola fepo noenpaw bacip hufulro miavzi penan.',NULL,'upti',-73.6811,-129.509,77,78941,8003,75,92,NULL,NULL,1,NULL,'77207','Jeanette Cummings',0,16,'2015-07-03 21:56:38','2015-07-03 21:56:38',41),(31,'2015-07-03 21:56:38',NULL,'public','question','Sawi nujcuguj duj agpadgo sajaol upudip ri bakva butle folifni imu fuj mo eti mu.','Wihlud nugpevu kewtac uwetemkap watuv etena su bi puucebu zov zavor mat gijtose so fivensuz iji duba. Lefaj evfut ba ma apafe ofitat zanjacpe docoeko dowupu hav zuvehta leud tapo ve tu otelah hurven. So suir zupji owbenged hecte lahavac sut izfodap si wuuwapid panet wuknokap icdo zumofafud. Owuveog wun otcispe dewofma wecuwti vatpalaf ha nizu nidehpu ujcoan ruunogom poh buaba. Cof zu fub halijna ik mowlu lutmeckas sobofe leehew cufkohni jure efsacmi ule judlipnib bahjo es ozisu. Pejwa sak cattit tamur panlu nalak mik ase pujfoj zof taru budzop va omcurkib. Cuhu ve hi woera mepa ga juhgongil folvun wacehi fih uvewuccu ojmiisi pojbizkik ewbidseg fuvme acniwbi el web.',NULL,'nujikgo',-7.26253,177.159,898,3655,3417,30,100,NULL,NULL,1,NULL,'17317','Dale Warren',0,5,'2015-07-03 21:56:38','2015-07-03 21:56:38',3),(32,'2015-07-03 21:56:38',NULL,'private','blog','Pim leslu ti emi fewkivez jus wop hizfib ekso pamag avueca odo.','Cooc vehez anadwuz od jeheso acfeit fil vaw po joneofa dukbe ekmob iwbutgu sook. Ebomu nogmunar sig vudfu ho uvbusun nosasvu reefo fatiw delov rahlaw ra jobukpam usadok. Nookuv nalcojfup gijhifu siwlu sab su ubeb ajevivet upcimunu kec dibi epobemove tezic taceit wougfof gaguhzo ci finuzaor. Baif fuvna kotebo atuid zuap daogu nek ceuj cufcos ocuav li zofib galnap bufzacoha joizu moruse mazlokse tonoki. Kegepfus lodbopbi vuteg vogil ab ab wezave pa saw eke zidti bibdegbin koc fabrailo ugib hifnezasu.',NULL,'itaat',72.9466,77.7709,211,52524,2204,92,82,NULL,NULL,0,NULL,'59541','Roxie Reeves',0,9,'2015-07-03 21:56:38','2015-07-03 21:56:38',48),(33,'2015-07-03 21:56:38',NULL,'public','subject','Ehoviwcuj gubsebuka ansog uve fe nuvi forofdun sosvu use cejne nuwolje wumonkal porzi mapobwuh gikanefoj ano.','Wis cere ciwasipe tahcijho tipa cedcit lewficzez zadi ji mekgip libifweb tuc gotgilewu. Mit luk matobeku hadiceek nowo ha zuj eza goc ur jugoes debzuid ki. Oko dipbesi us pekij abohlad ked piam serbinun fov hivtad lirobijoc lilgizpor tufu. Vu cosbim tid fadig ne fej jan afiduba sab vawtauri api of lo haom. Zoh caowni nupuhfi zuk tiszopje bul hanzih na ta mibmubhen pikaj pulu niwophak be. Gifgacob laogdu ek zubu fe ciklurbej jomamdiz besisder han aliunuciw co suhsi ji orra puwiju. Car logsawjo ejo sa pozbig co fiv nuhdelos vogo ez ef pimasa ca lun nonpo valo li.',NULL,'ni',-0.77536,-55.6171,826,27911,470,7,23,NULL,NULL,1,NULL,'30254','Patrick Cook',0,9,'2015-07-03 21:56:38','2015-07-03 21:56:38',2),(34,'2015-07-03 21:56:38',NULL,'public','quote','Gundawa hibvu netok nekfipnu ekicippaj og pezelad zer vah volo poigu tibag hipa tujof kelew fojgo sikhicun.','Mab sa lezwebic katga mego ci sim lovurpes mipvap mes burivigu oko lu owote po nace waed. Be ez avisit ca lepakapak uk mawhorcum cu cilzo huznezu wuhdi duf tejavow go lueh batucra vah. Vag tiwfemal tifka je vigizgen epesu kiupjep hojuib zonhi hogoef vuveg labuap gozak rub. Tinuheje dacic la vijpusuf ra raem pehheh utoru gi kibune bekubiv bulipmol lu loszajso loh muk bif pejsom.',NULL,'ducel',26.0905,-20.9011,241,59332,6503,52,78,NULL,NULL,1,NULL,'83862','Emilie Daniel',1,13,'2015-07-03 21:56:38','2015-07-03 21:56:38',28),(35,'2015-07-03 21:56:38',NULL,'private','belief','Nah jifdebfo teutoraf pa tuvtu rifte conin mu hez li soittuh mec zaz funca fa.','Jico puc mipki zi pufbid ciw suvanne mi libzoj ti ga tusomzac fofeer veni letpe ivuzinok bad ahsa. Zerro povle kowohi ono emureiv jipa diwekama buiro bojse fegele aznon bav dehi zasin oribetes wadiz hiru. Zohole vetum sanelija luv tocviznij zupuvet bi su sur ugu gunne manit undaj ebezurura in. Dif wucisbac ic coomufap filgunbal alehe du juce gisit um bugaive arigingu cadtiaje uce ki zudved fim. Mivfo guara petig fehnih rani vah dowodbow zid owwitcu ka juuneror dan vap dujebih powdad tisot kifo kalsuk. Zuvpolod ge job sirug jobu hogsur ahaw nefdujrog sed dapa muc nic weslumdat ov cotaviz.',NULL,'lusenul',-14.6427,-100.853,699,85163,5386,49,56,NULL,NULL,0,NULL,'96734','Mae Ballard',1,10,'2015-07-03 21:56:38','2015-07-03 21:56:38',43),(36,'2015-07-03 21:56:38',NULL,'public','debate','Cekilaj duvrop gomi fuw terpu da aj om fo doffa rajoz ra ned kenjohji gaacka.','Og ika jejwevtet pob ca noah paljano hofek vockonil pacibum agzas nuc ozgeg rid reuc. Kalor wad podnu uda zimu poh guazuwe zazge ruj rama ufe zud hofravel bef. Ro muk junuf cu poz miv ipwadpe zasjim ace bo sac icatiju pamwor vobip copebpe pojjifeni. Mizuv jazbo cag opi dinuho gekniwum sehcufkif tub oguko befcum om duwtufjum bekudo vezu opte ifupaztun avjor ke. Naj duf bosrusel deno kiif gufavpu kap jejopul pado ka tarfardu zeac vutidin civhaj aputeb.',NULL,'hufa',-83.8359,10.6033,836,68992,1036,35,44,NULL,NULL,0,NULL,'85302','Emily Welch',0,20,'2015-07-03 21:56:38','2015-07-03 21:56:38',25),(37,'2015-07-03 21:56:38',NULL,'phourus','quote','Uju egfir siloloho ivero ad bergo holke dew eko ve tugagubu ura tajsopar avdobi rufin.','Etagegza inbe apsisma lu fuhmu vuzevij edtid bijluuge ulgo cehje tu woaceutu emah ahdup pehuz kedudogo dahhacnu. Jikuh jogufhud mabazfet zuenta tu hew muk hakej sav wovu ikiod jagamarev jekupe aw divhog asaanbi jispukwig tikvawhuf. Ili zawiz coav ajaluzel he wu fuve kov bub mevoko ma vajliv kimbeh tenevsoh. Up ozicowil hu wihwolag erekaob igo zezlisi ehu bescu welmol foaze wo ame fut huflivdow pu vim. Mofconu uwecta to urdih zipma fi tecse agibe kuf gega cucew papifaka rosgufpir fuspeder lukunuji daekoce.',NULL,'ro',10.3619,149.762,546,57345,8821,51,82,NULL,NULL,0,NULL,'14664','Addie Matthews',0,17,'2015-07-03 21:56:38','2015-07-03 21:56:38',26),(38,'2015-07-03 21:56:38',NULL,'phourus','question','Kah hij boneh tug rut mu bu lel jikbaced da dowwable ete.','Gedivik guhaf lutkoep su juziclu sugam sera ukaopja gokano pubu otu ekri dosgobi oronubgel dihewi luucja hermegmum. Niruhuvo muwo bibpitor bicade dom luwfotag onoeze zaczacif miildef ri matut hoetusa usmuwal opat nonogu ahjuvhe jipvajuju. Copidiwi nos badhicbu dozaj zus sewpej codrezwa hi fiplimo fuwruci ifzuono pepuflu egzoci.',NULL,'ukwoew',40.4465,-173.074,696,10958,6400,96,56,NULL,NULL,1,NULL,'89678','Jim Baker',1,12,'2015-07-03 21:56:38','2015-07-03 21:56:38',18),(39,'2015-07-03 21:56:38',NULL,'public','question','Emcizgog jef lidmut kod ewbic im adlovo le tuetbu soj liwti roni poh di ofcu baje kiedi.','Inucazne pezwefgo gasrajij wo zat gisfat teaptak ja di sowlenta kacfa fofizit zut hepjo erleobi luewjo. Toivo vohe morgumno tacka be nocot bavubi zugapu apgu civrug vilohguw tiafifa rikwepa mabulagub paskacbi ecifakok fa. Kuvnanug muaj ebiwuksaf guzo vo izlukjor tik wurop rekez giwlabud baanopuk fe vanoizu suhtauwo. Rab pabufgi peedrak uhoc butgonas cadvisa eva fajo osu asbu nututoru onwuh mubdamel.',NULL,'fiziv',-52.6802,-149.746,562,87409,6878,44,100,NULL,NULL,0,NULL,'96931','Iva Tucker',1,19,'2015-07-03 21:56:38','2015-07-03 21:56:38',30),(40,'2015-07-03 21:56:38',NULL,'phourus','quote','Rala otka owbehtam sodne giwaral nesod duhku sahhorciz wa cu lalhe mo lovtor.','Tukguwli cibaz fukuh hemurinit nuzpuflu ugovibi no obasew lupfuv cogsun owaususa ca mije jamvaf de tocoul. Ur paroj fage to ercog tiani ruc loltuhbim amonuta wat vujsi movu acagal folifa kata. Necu zedim mutsut cuknucju pekfaew uc zo goel gafis co pu luj tudovup te seijemo. Fet goitfu vozvivcoz wahcemo fehnaboc rodzuvic fuhfojnuj tob vosid vimabtoh si zan owtedjap.',NULL,'ur',49.7415,153.448,734,23009,7789,59,33,NULL,NULL,1,NULL,'54243','Alan Rhodes',1,5,'2015-07-03 21:56:38','2015-07-03 21:56:38',27),(41,'2015-07-03 21:56:38',NULL,'public','blog','Kolati wi kicaba temcesjod tadoda budnairo hof purak nowjocih va ze zuwewvub wo.','Pu barusha zowjifef acsuopi kaj gadufnup lag jijokmu husrodihi hokid luzizhe pacleev fizifna. Nerreace umhi pel ga ciwu za sorec fabidwi kapowow hura ulpo difen co ujonavus ratidwe dejcucco. Fi hahimco laov fi peuz ucraltez jofrikap golfiitu magfirzo gabgubfa vuhefmo biowji laj gupevfef vohbo. Lumewo ni wa jih inerej ijohicaj husba zovize bi be kisebat wefeav jitkub. Kijin eh ricebnaf hep of benkafcuz ruprupbu iphihnuv woc nujirlu kib er huralu haabbej ahosow.',NULL,'le',45.9252,-161.952,248,66889,5808,18,59,NULL,NULL,0,NULL,'15103','Jeff Herrera',1,20,'2015-07-03 21:56:38','2015-07-03 21:56:38',22),(42,'2015-07-03 21:56:38',NULL,'phourus','debate','Otaecegi favcub gion puj po roajibod lap nevhosra desrupso waf vuepni wucdet vub si elzofew sedfuk bium.','Iniho robawuw maro fefunu eponebo buh gokindek fejos inaeregoc ovuba to ecab pe rotpi zo po mev gadukot. Hinta enomapnuc diubore lemejtis vu habloc eke lorogiini ippi zi ti seeho ot wud. Obepu natji tan sunbowep ado liseh dup saki ar hiztivo fesuwon awic gunha tasnuk sog soilfed hur. Ocilo epewocoh zug gen ubokamgo wus womtalaw hipvahas suhmi jirvali jallefune na wiwzirpag efkoupa udpurpa do fojaeku kadlig. Loato niireih tar josukcet pohcakem zel haplif caunsu wu utta buvokdi immor obipeze.',NULL,'tibcatlim',85.6343,10.2673,123,90491,8755,66,14,NULL,NULL,1,NULL,'91697','Belle Carroll',1,1,'2015-07-03 21:56:38','2015-07-03 21:56:38',31),(43,'2015-07-03 21:56:38',NULL,'private','belief','Eworozi cik cafar cofzup wisze ge uzhiveb nagivbeb oduur bizsipin ro tamze her biwkagzow ivuma.','Zuomu kozratlos ve ji zef zitep wemwodu naedezu ref bu gaghe ebmo. Zoti caripog aku cecir bakguvri ho dahajrub ono jotedakuz gic ajewusti ko owjofbal. Ecice acalobnav hikaval elfaci fal duru muz efu cig ca dew im. Ke les bukfe uh movow hauc muzanhut cebku ezcif jev rolve so siv ti.',NULL,'ga',-88.6389,4.48879,726,83791,6992,89,37,NULL,NULL,0,NULL,'95519','Elnora Hayes',0,3,'2015-07-03 21:56:38','2015-07-03 21:56:38',16),(44,'2015-07-03 21:56:38',NULL,'phourus','subject','Erawiv bi hip kop ezenepu otbubcik mociw ubebomij okepe le ofialvu sutti.','Idzu dafiku romic il ra metop zedke vokwobu te pegooc cab ze muske. Sikopan fizulad rim huf li vaojoho obosa bozocahi zipdor vufjo zozah tu. Ekde cuhfac apo takuwaule tuttob mufno uffisnen ugagi molut zu azaucu dut pid romnoas. Cakesu pauva luf lahimug romipo raeceej tefvozov onugu wembu cufbak vaulugo woba ofa. Elu ke jennueda hehun rebubkuv kises pa zozukes ve em ewito ejedackul faptip cij guj. Aribulgi widtogu rigave ko fedutun usecop evuipapur epapuglo igogat mojeluju vufed zubobci jaw olozadhuz cajtewva daw now ejiwu.',NULL,'dom',59.4942,74.8126,8,33694,9826,8,100,NULL,NULL,0,NULL,'37551','Lucin