L,'asdgasdg',NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2015-07-23 05:07:53','2015-07-23 05:07:53',NULL),(126,'2015-07-23 05:10:21',NULL,'private',NULL,'agsdgasdg',NULL,NULL,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2015-07-23 05:10:21','2015-07-23 05:10:21',NULL),(127,'2015-07-23 05:11:25',NULL,'private',NULL,'asdgasdggdsf','<div><b>blhjbkjbjkbbhbjhblkhjblkhbasdva</b></div><div><br></div><div>asdfasdf</div>',NULL,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2015-07-23 05:11:25','2015-07-24 02:39:34',NULL),(128,'2015-07-25 17:05:41',NULL,'',NULL,'Some New Post','<div>asdsdfgsdfg</div>',NULL,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,'2015-07-25 17:05:41','2015-07-25 17:05:41',NULL),(129,'2015-07-25 17:09:28',NULL,'org',NULL,'Another','<div>gadsgadsgdfg</div>',NULL,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,3,'2015-07-25 17:09:28','2015-07-25 17:09:28',NULL),(130,'2015-07-25 17:11:26',NULL,'phourus','question','New Title','<div>Updated Content</div>',NULL,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,4,'2015-07-25 17:11:26','2015-07-26 01:44:03',106),(131,'2015-07-25 21:42:06',NULL,'org','blog','New Post','<div><span style=\"font-family: \'Trebuchet MS\'; font-size: 21.3333333333333px; background-color: transparent;\">BASICS</span></div><div><span style=\"font-family: \'Trebuchet MS\'; font-size: 17.3333333333333px; background-color: transparent;\">What is Phourus?</span></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">Phourus is the discovery of truth, individually, organizationally and societally, built for the 4 elements of society: Business, Education, Politics and Religion.</span></div><div><br></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">For individuals, Phourus is a free tool to express themselves professionally, educationally, politically and religiously. It is a place where expression and representation meet.</span></div><div><br></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">For organizations, such as businesses, government agencies, religious/charitable organizations and educational institutions, Phourus is a tool to create valuable content both internally and externally, with a competitive, social spin with the purpose of giving higher visibility to great content and encouraging members to share their voice.</span><span style=\"font-family: \'Trebuchet MS\'; font-size: 17.3333333333333px; background-color: transparent;\">How does it work?</span><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">Phourus might sound complicated, but it\'s really not. It consists of a few basic actions:Create an accountCreate posts (explained in next section)Find and interact with postsCompete to become a Leader (explained below)Use within an Organization as a social content tool</span></div><div><br></div><div><span style=\"font-family: \'Trebuchet MS\'; font-size: 17.3333333333333px; background-color: transparent;\">What kind of posts can I create on Phourus?</span></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">Each element of Phourus has two associated post types to choose from:Blogs &amp; Events: General posts and real-life eventsSubjects &amp; Questions: Educational posts and Q&amp;ADebates &amp; Polls: Polarized discussions and survey-style pollingBeliefs &amp; Quotes: Deep-seated thoughts and meaningful quotes</span></div><div><br></div><div><span style=\"font-family: \'Trebuchet MS\'; font-size: 21.3333333333333px; background-color: transparent;\">ADVANCED</span></div><div><span style=\"font-family: \'Trebuchet MS\'; font-size: 17.3333333333333px; background-color: transparent;\">What is Influence?</span></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">Influence is a scoring algorithm for identifying and promoting truth and insightful content rather than paid-for/biased content, and is a core concept to the Phourus vision. We want to make it easy for Phourus users to discover valuable and insightful content, and Influence is one of our tools to do just that.</span></div><div><br></div><div><span style=\"font-family: \'Trebuchet MS\'; font-size: 17.3333333333333px; background-color: transparent;\">What are Leaders?</span></div><div><br></div><div><span style=\"font-family: \'Trebuchet MS\'; font-size: 17.3333333333333px; background-color: transparent;\">What are Organizational accounts?</span></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">Success of an organization relies on the ability to capture the truth from it\'s members. Phourus is essentially an investment in your people. Think of Phourus as both an internal + external social wiki, documenting who and what your organization is. It is about building the culture of your organization while being both a public and private document-repository. </span></div><div><br></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">True culture is not a ping-pong table and blue jeans, it is embracing the diversity and expertise of the people who make up that organization.</span></div><div><br></div><div><span style=\"font-family: \'Trebuchet MS\'; font-size: 21.3333333333333px; background-color: transparent;\">MORE</span></div><div><span style=\"font-family: \'Trebuchet MS\'; font-size: 17.3333333333333px; background-color: transparent;\">Can I import or export my posts?</span></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">Your content is extremely important to you and to Phourus. That\'s why we\'re working hard to giving you all of the following options to safely and securely store and export content:Automated Backups: Phourus uses Amazon Web Services (AWS), the world standard in cloud hosting and data storage. We backup all Phourus data regularly using their secure, proven technology.Export Feature: At any time, you can export a single post or all of your content with a single click to PDF, Microsoft Word or Google Drive formats.Optional Weekly/Monthly Email: In addition, we can optionally send you a weekly or monthly email with a full PDF containing the entire \'story\' of your profile, containing all of your posts.Aside from our options for exporting your data, we are also working hard to offer you multiple ways to import content you\'ve already created, rather than start from scratchGoogle Drive: Google Drive is an excellent authoring tool, but lacks some of the search, social and competitive features of PhourusRSS Feeds: For bloggers, import content you\'ve created as an RSS feed. No need to recreate on Phourus or worrying about syncing changesSocial Feeds: Import existing posts or share Phourus posts with popular social media sites such as Facebook, Twitter, Google+ and LinkedInMultimedia: Add videos from Youtube, links to 3rd-party sites and even audio or podcasts for full multimedia capabilities</span></div><div><br></div><div><span style=\"font-family: \'Trebuchet MS\'; font-size: 17.3333333333333px; background-color: transparent;\">What do you do with my data?</span></div><div><span style=\"font-family: Arial; font-size: 14.6666666666667px; background-color: transparent;\">Phourus has multiple privacy settings for each post you create. Private posts are for your eyes only, while Phourus member posts are only for members of Phourus. Public posts, on the other hand, are available to anyone, including search engines like Google and Yahoo!. </span></div><div><span style=\"font-family: Arial; font-size: 14.6666666666667px; background-color: transparent;\">We will never sell personal data to 3rd party companies. We encourage users to donate their data anonymously so we can create cool and exciting data tools for users and customers. Ultimately we want users to be represented on Phourus, and these advanced algorithms and data analysis techniques can be used to do just that.</span></div><div><span style=\"font-family: Arial; font-size: 14.6666666666667px; background-color: transparent;\">Ultimately, users create content on Phourus to be heard, and we want to make that happen on both a micro and macro level.</span><span style=\"font-family: \'Trebuchet MS\'; font-size: 17.3333333333333px; background-color: transparent;\">What platforms does Phourus support</span><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">Phourus understands how valuable being able to access your content via multiple devices is. That\'s why we\'ve put the time into ensuring the web-based application is available on mobile and tablet devices via the web-browser, as well as iOS and Android apps.Unlike some apps that are totally different on each platform, requiring you to re-learn the tool for each device, Phourus uses the same app but simply formats it for each device in a way that is both easy-to-use and consistent among each platform.In addition, Phourus has plans to offer a desktop application that can be accessed like any software application, and will even support offline access should you be without an internet connection.</span></div><div><br></div><div><span style=\"font-family: \'Trebuchet MS\'; font-size: 17.3333333333333px; background-color: transparent;\">How do I get started?</span></div><div><br></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">For individuals, it\'s as simple as signing up! Simply register with your email, fill out your profile, and start using Phourus today.For organizations, the best way is to contact us so we can discuss your needs and how we can help. We want to work very closely with your organization to deliver the best possible experience and value, so let\'s chat!</span></div><div><br></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">Phourus Inc.1149 </span></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">7th Street #305</span></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">Santa Monica, CA 90401</span></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">1-800-PHOURUS</span></div><div><span style=\"font-family: Arial; font-size: 16px; background-color: transparent;\">1-800-746-8787</span></div><div><span style=\"color: rgb(52, 152, 219); font-family: Arial; font-size: 16px; background-color: transparent;\">info@phourus.com</span></div>',NULL,NULL,NULL,NULL,0,0,0,0,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,2,'2015-07-25 21:42:06','2015-07-26 01:34:02',106);
